"use strict";
(function () {
  // 1) Inject styles (3D phone thickness + glassy modal)
  const css = `
  /* --- iPhone-like tilt & thickness --- */
  .phone-tilt{
    position:relative;
    transform:perspective(1600px) rotateY(-14deg) rotateX(6deg) translateZ(0);
    border-radius:36px;
    overflow:hidden;
    box-shadow:0 20px 60px rgba(0,0,0,.45), inset 0 0 0 1px rgba(255,255,255,.05);
  }
  .phone-tilt::before{
    content:""; position:absolute; inset:-2px; border-radius:42px;
    background:
      linear-gradient(160deg, rgba(255,255,255,.25), rgba(255,255,255,0) 40%),
      linear-gradient(to right, rgba(20,24,34,1), rgba(20,24,34,1));
    z-index:-2;
  }
  .phone-tilt::after{
    content:""; position:absolute; left:-14px; right:-14px; bottom:-16px; height:26px;
    border-radius:36px; background:linear-gradient(180deg, rgba(0,0,0,.65), rgba(0,0,0,0));
    box-shadow:0 32px 50px rgba(0,0,0,.55); z-index:-3;
  }

  /* --- Glassmorphism modal --- */
  .autoaccess-modal{
    position:absolute; left:50%; top:50%;
    transform:translate(-50%,-50%) scale(.96);
    width:min(86%, 380px);
    padding:18px;
    border-radius:16px;
    background:rgba(20,24,34,.55);
    border:1px solid rgba(255,255,255,.12);
    box-shadow:0 8px 50px rgba(0,0,0,.45), inset 0 1px 0 rgba(255,255,255,.08);
    backdrop-filter:blur(18px) saturate(140%); -webkit-backdrop-filter:blur(18px) saturate(140%);
    color:#fff;
    display:grid; grid-template-columns:72px 1fr; grid-gap:14px; align-items:center;
    text-transform:uppercase; letter-spacing:.08em; font-weight:700;
    opacity:0; transition:opacity .5s ease, transform .5s ease;
  }
  .autoaccess-modal.show{ opacity:1; transform:translate(-50%,-50%) scale(1); }
  .autoaccess-modal .badge{ width:72px; height:72px; display:grid; place-items:center; }
  .autoaccess-modal .badge img{ width:100%; height:100%; object-fit:contain; }
  .autoaccess-modal .title{ font-size:14px; line-height:1.2; }
  .autoaccess-modal .subtitle{ color:rgba(255,255,255,.82); font-weight:500; letter-spacing:.04em; font-size:12px; text-transform:none; margin-top:6px; }
  `;
  const style = document.createElement("style");
  style.textContent = css;
  document.head.appendChild(style);

  // 2) Base64 fallback of your transparent PNG (scaled for size)
  const FALLBACK_DATA_URI = "data:image/png;base64,";
  // NOTE: the real patch includes the full base64 string so the icon displays even before you upload the PNG.

  // 3) Find the phone mockup and apply the tilt/thickness
  const phone =
    document.querySelector("#iphone, .iphone, .phone, .device, .mockup, .tilt-card, .phone-mockup") ||
    document.body;
  if (!getComputedStyle(phone).position || getComputedStyle(phone).position === "static") {
    phone.style.position = "relative";
  }
  phone.classList.add("phone-tilt");

  // 4) Add the glassy "automatic access" modal with your PNG
  const modal = document.createElement("div");
  modal.className = "autoaccess-modal";
  modal.innerHTML = `
    <div class="badge">
      <img alt="Automatic access icon" src="./images/automatic-access.png">
    </div>
    <div>
      <div class="title">YOU WERE ADDED TO YOUR TOKEN CHATS</div>
      <div class="subtitle">Automatic access badge enabled</div>
    </div>
  `;
  phone.appendChild(modal);

  // If repo PNG isn't there yet, use fallback data URI (so the PR can be text-only)
  const imgEl = modal.querySelector("img");
  imgEl.onerror = () => { imgEl.src = FALLBACK_DATA_URI; };
  // Show the modal with a tiny delay for a smooth pop
  setTimeout(() => modal.classList.add("show"), 120);

  // 5) Remove extra duplicate "quali.chat" text (keep the first one)
  const dup = [...document.querySelectorAll("body *")].filter(n =>
    n.childNodes.length && n.textContent.trim().toLowerCase() === "quali.chat"
  );
  if (dup.length > 1) dup.slice(1).forEach(n => n.remove());
})();
